PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
ASK {
  {
    SELECT ( MAX( ?pop2010 ) AS ?pop2010Max ) ( MAX( ?popRecent ) AS ?popRecentMax ) WHERE {
      wd:Q183 p:P1082 ?statement2010 .
      ?statement2010 ps:P1082 ?pop2010 ; pq:P585 ?date2010 .
      FILTER ( YEAR( ?date2010 ) = 2010 ) wd:Q183 p:P1082 ?statementRecent .
      ?statementRecent ps:P1082 ?popRecent ; pq:P585 ?dateRecent .
      FILTER ( YEAR( ?dateRecent ) = 2022 )
    }
  }
  FILTER ( ( ?popRecentMax - ?pop2010Max ) / ?pop2010Max >= 0.01 )
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
