SELECT ?archipelago ?archipelagoLabel ( COUNT( DISTINCT ?island ) AS ?islandCount ) WHERE {
  VALUES ( ?archipelago ) {
    ( wd:Q38095 ) ( wd:Q192626 )
  }
  {
    ?archipelago wdt:P527 ?island .
    FILTER ( ?archipelago != wd:Q192626 || ?island != wd:Q183110 )
  } UNION {
    FILTER ( ?archipelago = wd:Q192626 ) wd:Q183110 wdt:P527 ?island .
  }
  OPTIONAL {
    ?archipelago rdfs:label ?archipelagoLabel FILTER ( LANG( ?archipelagoLabel ) = "en" )
  }
}
GROUP BY ?archipelago ?archipelagoLabel
ORDER BY DESC ( ?islandCount )

